import React from "react";
import { connect } from "react-redux";
import PlayerCard from "./PlayerCard";

const PlayerCardList = props => {
  const playerName = [props.game[0].player, props.game[1].player];
  const playerList = playerName.map((cur, index) => (
    <PlayerCard
      name={cur}
      score={props.game[{ index }].score}
      points={props.game[{ index }]}
    />
  ));
  return <div>{playerList}</div>;
};

const mapStateToProps = state => {
  return { game: state.game };
};

export default connect(mapStateToProps)(PlayerCardList);
